package sivl.platform.file.model;import java.io.Serializable;/** * 文件结构载体 * 目的： * @author lixuefeng * @date 2016年1月7日 * @version 1.0 * @param <T> */public class FileResultModel<T> implements Serializable {	private static final long serialVersionUID = 1L;	private int code;	private String message;	private T data;	public FileResultModel(int code) {		super();		this.code = code;	}	public FileResultModel(int code, String message) {		super();		this.code = code;		this.message = message;	}	public FileResultModel(int code, T data) {		super();		this.code = code;		this.data = data;	}	public String getMessage() {		return message;	}	public void setMessage(String message) {		this.message = message;	}	public int getCode() {		return code;	}	public void setCode(int code) {		this.code = code;	}	public T getData() {		return data;	}	public void setData(T data) {		this.data = data;	}		@Override	public String toString() {		return "FileResultModel [code=" + code + ", message=" + message				+ ", data=" + data + "]";	}}